import React from "react";

const Monday = ({breakfastRecipes}) => {

    const typicalBreakfast = function(breakfastRecipes){
        const breakfast = recipes.filter(recipe => recipe.type === "Breakfast");
    //     const indexSausageEggSalad = breakfast.indexOf(recipes.name === "Sausage And Egg Salad");
    //     breakfast.splice(indexSausageEggSalad, 1);
    //     return breakfast;
    }

    const breakfast = breakfastRecipes.map((recipe) => {
            return(
                <div key={recipe._id}>
                    <p>{recipe.name}</p>
                </div>
            );
    });

    return(
        <>
        <p>Monday</p>
        <p>{breakfast}</p>
        </>
    );

}

export default Monday;
